import React from "react";

function Aboutus() {
    return (
        <div class="aboutus grid-cont">
        <div class="about-text">
            <div class="aboutustitle">
                ABOUT US
            </div>
            <blockquote class="otro-blockquote"><p>Morales ha convertido la ya d√∫ctil democracia boliviana en una plastilina con la que sus manos juegan a su antojo.</p></blockquote>
<br />
{/* <blockquote class="otro-blockquote">
  Creativity is just connecting things. When you ask creative people how they did something, they feel a little guilty because they didn't really do it, they just saw something. It seemed obvious to them after a while. That's because they were able to connect experiences they've had and synthesize new things.
  <span>Steve Jobs</span>
</blockquote> */}
        </div>
        <div class="about-img">
        <img id = "womancook" class = "img-fluid" src="./images/auntytest.svg" alt="Woman Cooking"/>
        </div>
      </div>
